import React from 'react'
import barrel from '../assets/barrel.png';
import caracas from '../assets/caracas.png';
import events from '../assets/events.png';
import macro from '../assets/macro.png';

export default function Portfolio() {
  return (
    <div id="portfolio-section">
      <h2>Macro Manager</h2>
      <a href="https://macromanager.surge.sh" target="_blank">Link</a>
      <h2>Events Express</h2>
      <a href="https://events-express.surge.sh" target="_blank">Link</a>
      <h2>Barrel-Aged</h2>
      <a href="https://barrel-aged.surge.sh" target="_blank">Link</a>
      <h2>Caracas</h2>
      <a href="https://caracas-restaurant.surge.sh" target="_blank">Link</a>
      <h2>Curtain Call</h2>
      <a href="https://curtain-call.surge.sh" target="_blank">Link</a>
    </div>
  )
}
